window.bookSummaryJSON = "<p><b>From</b><b><i> New York Times</i></b><b> best-selling author Allison Brennan comes the newest audiobook in the Lucy Kincaid series.</b> </p> <p>Bella Caruso survived a nightmare of abuse and betrayal. Today, she has dedicated her life to saving other young women from the hell that almost killed her - first as an officer of the law, then by stepping outside the law and into the darkness where true evil dwells. Now, it appears that the darkness has taken her once again. </p> <p>JT Caruso often worries about his sister, given her line of work. This time, when he learns that Bella is working undercover to find a missing girl involved in a dangerous prostitution ring, JT asks FBI Special Agent Lucy Kincaid for help. Even with Lucy's extensive experience in running down human traffickers, finding Bella will not be easy. Not only because she is in too deep. But because Bella, who will not rest until she saves the girl, doesn't want to be found.... </p> <p><b>From start to finish, </b><b><i>Breaking Point</i></b><b> is an audiobook that will get your heart racing.</b> </p> <p><b>“Brennan [is] a master.” (Associated Press)</b></p> <p><b>“Can't-Put-It-Down Suspense” (Fresh Fiction)</b></p>"; 
